import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';
import dubaiFlag from './images/dubai-flag.png'; // Adjust the path as necessary

const NavBar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        Dubai Project
      </div>
      <ul className="navbar-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/services">Services</Link></li>
        <li><Link to="/real-estate">Real Estate</Link></li>
        <li><Link to="/medical-vacation">Medical Vacation</Link></li>
        <li><Link to="/business-solutions">Business Solutions</Link></li>
        <li><Link to="/about-us">About Us</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
      <div className="navbar-actions">
        <img src={dubaiFlag} alt="Dubai Flag" className="dubai-flag" />
        <button className="lang-button">عربي</button>
      </div>
    </nav>
  );
}

export default NavBar;
